Happy to be supporting the Empathy Project. 
Empathy to me, means having compassion for all people no matter their religion, race or sexual orientation. To me, real empathy doesn’t allow us to hate one person and love another. We’re all in this together and we need to learn to live together. War is not the answer. We must ceasefire, not just in Gaza, and the Ukraine but wherever there is war, indifference and racism. The only thing I can control right now is my own mind, I can stop the war and quell the anger in my own heart. I can protect and support others by cultivating empathy. And this empathy extends to all life. I hope we can grow our empathy to the point where we feel the same care and concern for a mother cow and her calf as we do for a human mother and child. We all just want to be happy. 🙏🏼 I think this project is important because it encourages us to think about what empathy is and, why it’s important to stamp out our apathy and grow our compassion. 

